(1908, 1, '2021-06-07 11:39:27', '2021-06-07 11:39:27', '<h1>\n									We Are Creative Agency<br />\nFocused On 								</h1>\n																			The world without photography will be meaningless\n					    					    						    <a href=\"#\">\n						    								    read more\n							</a>\n																<h1>\n									We Are Creative Agency<br />\nFocused On 								</h1>\n																			The world without photography will be meaningless\n					    					    						    <a href=\"#\">\n						    								    read more\n							</a>\n				                  <h2>We Are Novo<br />\nCreative Studio.</h2>\n		The world without photography will be meaningless to us if there is no light and color, which opens up our minds and expresses passion.		\n                            <h6>Web Design</h6>\n                  95%\n                                      <p>To make the most of the collective genius of all the people involved.</p>\n                            <h6>Branding</h6>\n                  90%\n                                      <p>Its not just about money, we prioritize the success in all we do.</p>\n                            <h6>UI/UX Design</h6>\n                  85%\n                                      <p>We believe in the value of metrics of results, sales, impact and culture.</p>\n                            <h6>Graphic Design</h6>\n                  98%\n                                      <p>We practice what we preach. We listen to all voices.</p>\n			<a href=\"#\" target=\"_self\" rel=\"noopener\">\n								read more\n							</a>\n				                  <h2>About Us</h2>\n            <style>.elementor-1964 .elementor-element.elementor-element-a53108b .icon-box .icon i{transform:rotate(0deg);}.elementor-1964 .elementor-element.elementor-element-4f069c0 .button-container{text-align:left;}</style>		\n							<section data-id=\"34d70770\" data-element_type=\"section\">\n								My style is a combination between photojournalism and fine-art photography with a to